import React, {useContext} from 'react'

// Context:
import {CoinsContext} from "../Context/CoinsContext"

const Dashboard = () => {
const {allCoins} = useContext(CoinsContext);



    return (
        <div>
            Home Page
            <h2>Coins</h2>
            <ul>
            {allCoins.map(singleCoin => {
                const{Id, Name, Symbol} = singleCoin;
                return(
                    <li key={Id}>
                        {Symbol}
                    </li>
                )
            })}
            </ul>
        </div>
    )
}

export default Dashboard;
